import React, { useState } from 'react'
import { useNavigate } from 'react-router-dom'

function ShopList() {

    const navigate = useNavigate()

    const [shopData, setShopData] = useState([
        {
            'shopName':"Malabar",
            'description':"This is the best shop near you",
            'LicenseNumber':223123123242,
            'rating':5
        },
        {
            'shopName':"Udupi",
            'description':"This is the best shop near you",
            'LicenseNumber':223123123242,
            'rating':5
        },
    ])
  return (
    <div className=''>
        {shopData.map(shop=>{
            return (
                <div  onClick={()=>navigate('store')} className='border border-gray-500 p-3 m-2 rounded-md cursor-pointer hover:border-blue-500 hover:bg-blue-100'>
               
               <div>
                
                </div> 
                </div>
     
            )
        })}
    </div>
  )
}

export default ShopList
